import React from "react";
import s from './Footer.module.scss';


export const Footer = () => {
    return(
        <div className={s.wrapper}>
            <div className={s.footer}>
            <img src="https://i5.walmartimages.com/asr/f6c4bc0d-8baa-4927-b008-c964f5c2d24c.60e9c0bac2df9388c2a50681e521fe19.png?odnHeight=612&odnWidth=612&odnBg=FFFFFF"/>
            </div>

                <p className="citatafooter">Жить — значит рисковать всем. 
                В противном случае ты просто вялая кучка беспорядочно собранных молекул, плывущих по течению Вселенной.
                </p>
        </div>
    )
}
